INSERT INTO `empresas` (`id`, `descripcion`, `file_image`, `created_at`, `updated_at`) VALUES
(1, '<p>Somos Distribuidora Zalazar,&nbsp;una empresa familiar de amplia trayectoria en distribuci&oacute;n&nbsp;de repuestos para sanitarios,&nbsp;gas, electrobombas, grifer&iacute;as, ferreteria&nbsp;y afines.</p>\r\n\r\n<p>Nuestros clientes y m&aacute;s de 20 a&ntilde;os de trayectoria avalan nuestro compromiso por consolidar un mercado siempre en expansi&oacute;n, incorporando nuevas tecnolog&iacute;as en materia de distribuci&oacute;n, log&iacute;stica y servicios para llegar a todos los sectores del pa&iacute;s.&nbsp;&nbsp;</p>\r\n\r\n<p>Nuestros principios est&aacute;n basados en una estrecha relacion de&nbsp;confianza, trabajo y profesionalismo de nuestros recursos humanos para con nuestros clientes y proveedores, logrando un stock permanente, un extenso cat&aacute;logo y asesoramiento profesional.</p>', 'empresa__empresa.jpg', NULL, '2019-04-22 14:29:37');
