(22, 'ASIENTO PARA BAÑERA', NULL, '<p>Asiento de apoyo para ba&ntilde;era de alta calidad y&nbsp;resistencia a la corrosi&oacute;n con tapa de alto impacto.</p>\r\n\r\n<p>Especial para cuartos de ba&ntilde;o.</p>\r\n\r\n<p>Medidas:<br />\r\nLongitud: 72cm<br />\r\nDi&aacute;metro del asiento: 30cm</p>\r\n\r\n<p>Ind. Argentina.<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;</p>', 'subfamilias__ASIENTO PARA BAÑERA.jpg', NULL, 13, '2019-01-07 22:54:30', '2019-03-29 22:02:27'),
(23, 'BARRAL DE ACCESO', NULL, '<p>Barral de acceso de varias posiciones.&nbsp;Incluye fijaciones y tarugos.</p>\r\n\r\n<p>Longitud: 70cm</p>\r\n\r\n<p>Altura: 20cm</p>\r\n\r\n<p>Ind. Argentina.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__4.jpg', NULL, 13, '2019-01-07 22:54:30', '2019-03-31 04:24:31'),
(24, 'BARRAL DE SEGURIDAD ACERO INOXIDABLE', NULL, '<p>Incluye fijaciones y tarugos.</p>', 'subfamilias__BARRAL DE SEGURIDAD ACERO INOX.jpg', NULL, 13, '2019-01-07 22:54:30', '2019-04-22 10:42:28'),
(25, 'BARRAL DE SEGURIDAD CROMADO', NULL, '<p>Incluye fijaciones y tarugos.</p>', 'subfamilias__BARRAL DE SEGURIDAD CROMO.jpg', NULL, 13, '2019-01-07 22:54:30', '2019-03-30 00:24:07'),
(27, 'BARRAL DE SEGURIDAD EPOXI BLANCO', NULL, NULL, 'subfamilias__BARRAL DE SEGURIDAD EPOXI BLANCO.jpg', NULL, 13, '2019-01-07 22:54:30', '2019-03-30 00:31:08'),
(28, 'BOMBA AUTOASPIRANTE MOTORARG', NULL, '<h4>L&Iacute;NEA BF</h4>\r\n\r\n<p>La l&iacute;nea de bombas autoaspirantes &ldquo;BF&rdquo;, de gran poder de aspiraci&oacute;n y cebado, est&aacute; dise&ntilde;ada para bombear hasta 8 metros de profundidad.<br />\r\nSon recomendadas para trabajar bombeando desde pozos abiertos o cisternas, colocando siempre una v&aacute;lvula de retenci&oacute;n de pie en el extremo de la ca&ntilde;er&iacute;a de aspiraci&oacute;n.</p>\r\n\r\n<p><strong>Tipo de agua:&nbsp;</strong>Limpia</p>\r\n\r\n<p><strong>Instalaci&oacute;n:&nbsp;</strong>Tanque Elevado o Cisterna, Perforaci&oacute;n o Pozo</p>\r\n\r\n<p><strong>Uso:&nbsp;</strong>Dom&eacute;stico</p>\r\n\r\n<p>Caracter&iacute;sticas:</p>\r\n\r\n<p>&bull;Cuerpo de Fundici&oacute;n de Hierro<br />\r\n&bull;Impulsor y difusores en tecnopol&iacute;mero de alta resistencia<br />\r\n&bull;Sello mec&aacute;nico autoajustable de grafito/cer&aacute;mica<br />\r\n&bull;Eje de Acero Inoxidable: prolonga la vida &uacute;til del equipo.<br />\r\n&bull;Protector t&eacute;rmico incorporado (en monof&aacute;sicas)<br />\r\n&bull;Motor aislaci&oacute;n clase B &ndash; IP 44<br />\r\n&bull;Cumplen con las normas de seguridad el&eacute;ctrica internacionales IEC<br />\r\n&bull;Motor el&eacute;ctrico blindado 100%</p>', 'subfamilias__BF.jpg', 'subfamilia28.pdf', 14, '2019-01-07 22:54:30', '2019-02-06 02:15:46'),
(29, 'BOMBA ELEVADORA AUTOMATICA BTM', NULL, '<p><span style=\"font-size:36px\">LINEA SMART</span></p>\r\n\r\n<p>La linea de bombas elevadoras automaticas Smart se emplean para el suministro de agua a&nbsp;tanques elevados en instalaciones domiciliarias. Es de muy facil instalacion y montaje ya que no requiere cableado electrico entre el tanque elevado y la bomba. Pueden ser utilizadas en instalaciones con tanque cisterna o en instalaciones que tomen directamente de la red (En caso&nbsp;que este permitido). Las bombas Smart estan previamente calibradas y no requieren regulaciones particulares para cada instalacion. Para facilitar la instalacion y posterior servicio el producto esta provisto de valvulas de entrada y salida con uniones dobles.</p>\r\n\r\n<p>Caracteristicas:</p>\r\n\r\n<p>.Llenado automatico de tanque elevado.</p>\r\n\r\n<p>.Facil y rapida instalacion.</p>\r\n\r\n<p>.Proteccion ante la falta de suministro de agua.</p>\r\n\r\n<p>.Proteccion contra alta y baja tension.</p>\r\n\r\n<p>.Alta eficiencia energetica, bajo consumo de energia.</p>\r\n\r\n<p>.Marcha autoajustable de acuerdo al consumo.</p>\r\n\r\n<p>.No requiere flotante automatico.</p>\r\n\r\n<p>.No requiere engorrosos cableados con el tanque elevado.</p>\r\n\r\n<p>.No requiere cisterna, puede tomar directo de la red.</p>', 'subfamilias__BOMBA ELEVADORA AUTOMATICA BTM.jpg', 'subfamilia29.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 00:41:21'),
(30, 'BOMBA HIDROMASAJE BTM', NULL, '<p><span style=\"font-size:36px\">LINEA HIDROMAX</span></p>\r\n\r\n<p>L&iacute;nea de bombas Hidromax para hidromasajes y spa.</p>\r\n\r\n<p>El conjunto hidr&aacute;ulico de la bomba esta especialmente dise&ntilde;ado con un sistema autodrenante para mantener las tuber&iacute;as totalmente limpias y libres&nbsp;de contaminaci&oacute;n.</p>', 'subfamilias__BOMBA HIDROMASAJE BTM.jpg', 'subfamilia30.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 01:07:35'),
(31, 'BOMBA PRESURIZADORA ITALTEC', NULL, '<p><span style=\"font-size:36px\">LINEA ITALTEC</span></p>\r\n\r\n<p>Sistema regulador de presi&oacute;n en instalaciones o sistemas dom&eacute;sticos.</p>', 'subfamilias__ITALTEC.jpg', 'subfamilia31.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 01:42:54'),
(32, 'BOMBA PRESURIZADORA PLUVIUS', NULL, '<p><span style=\"font-size:36px\">LINEA PLUVIUS</span></p>\r\n\r\n<p>Sistema regulador de presi&oacute;n en instalaciones o sistemas dom&eacute;sticos.</p>', 'subfamilias__BOMBA PRESURIZADORA PLUVIUS.jpg', 'subfamilia32.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 01:54:45'),
(33, 'BOMBA SUMERGIBLE PORTATIL ACERO INOXIDABLE MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA SD Y SM</span>&nbsp;</p>\r\n\r\n<p>La l&iacute;nea de electrobombas sumergibles port&aacute;tiles para desagote dom&eacute;stico est&aacute;n dise&ntilde;adas para bombear aguas.</p>\r\n\r\n<p><strong>SD</strong>&nbsp;est&aacute;n dise&ntilde;adas para bombear aguas claras o ligeramente sucias en suspensi&oacute;n hasta &Oslash; 10 mm.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo o fuente</p>\r\n\r\n<p>- Uso:&nbsp;Dom&eacute;stico</p>\r\n\r\n<p><strong>SM</strong>&nbsp;est&aacute;n dise&ntilde;ada para bombear aguas sucias con peque&ntilde;os s&oacute;lidos en suspensi&oacute;n hasta &Oslash; 20 mm.</p>\r\n\r\n<p>- Tipo de agua: Limpia&nbsp;con s&oacute;lidos en suspensi&oacute;n</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo o fuente</p>\r\n\r\n<p>- Uso:&nbsp;Dom&eacute;stico</p>', 'subfamilias__BOMBA SUMERGIBLE PORTATIL ACERO INOXIDABLE MOTORARG.jpg', 'subfamilia33.pdf', 14, '2019-01-07 22:54:30', '2019-03-31 01:19:26'),
(34, 'BOMBA SUMERGIBLE PARA POZO 4\" MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA 4 PACK</span></p>\r\n\r\n<p>La l&iacute;nea de electrobombas sumergibles &ldquo;4PACK&rdquo; con bridas de aspiraci&oacute;n y descarga en tecnopol&iacute;mero est&aacute; dise&ntilde;ada para la extracci&oacute;n de agua en pozos profundos de 4&Prime; encamisados con ca&ntilde;o de 110 mm de di&aacute;metro exterior (100&nbsp;mm interior). Ideales para riegos en general, elevaci&oacute;n a tanques elevados y cisterna, llenado de piscinas, desagote de agua limpia y bebederos, en el &aacute;mbito civil, industrial y agropecuario.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo</p>\r\n\r\n<p>- Uso:&nbsp;Dom&eacute;stico,&nbsp;Construcci&oacute;n Civil</p>', 'subfamilias__BOMBA SUMERGIBLE PARA POZO 4 MOTORARG.jpg', 'subfamilia34.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 06:57:39'),
(35, 'BOMBA SUMERGIBLE PORTATIL HF MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA DRV</span></p>\r\n\r\n<p>La l&iacute;nea de electrobombas sumergibles port&aacute;tiles para desagote pluvial DRV&nbsp;brinda una &oacute;ptima prestaci&oacute;n hidr&aacute;ulica en el bombeo de aguas sucias o cargadas con s&oacute;lidos en suspensi&oacute;n hasta 35 mm de di&aacute;metro debido a su sistema VORTEX. Es apta para el bombeo en sumideros, desag&uuml;es pluviales, garajes, s&oacute;tanos, piscinas, etc, sumergi&eacute;ndola directamente en el lugar a desagotar.</p>\r\n\r\n<p>- Tipo de agua: Sucia con s&oacute;lidos hasta &Oslash; 35 mm.</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo, obra, sumidero, etc.</p>\r\n\r\n<p>- Uso: Dom&eacute;stico, agr&iacute;cola, industrial, construcci&oacute;n civil.</p>', 'subfamilias__BOMBA SUMERGIBLE PORTATIL HF MOTORARG.jpg', 'subfamilia35.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 07:10:22'),
(36, 'BOMBA SUMERGIBLE PLASTICA MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA&nbsp;SAP Y SAP AS</span></p>\r\n\r\n<p>Las&nbsp;electrobombas sumergibles port&aacute;tiles se emplean para desagote dom&eacute;stico.&nbsp;De f&aacute;cil instalaci&oacute;n se sumergen directamente en el lugar a desagotar.</p>\r\n\r\n<p>SAP&nbsp;est&aacute; dise&ntilde;ada para bombear aguas claras o ligeramente sucias con peque&ntilde;os s&oacute;lidos en suspensi&oacute;n hasta &Oslash; 10 mm.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo o fuente</p>\r\n\r\n<p>- Uso: Dom&eacute;stico</p>\r\n\r\n<p><br />\r\nSAP AS est&aacute; dise&ntilde;ada para bombear aguas sucias con peque&ntilde;os s&oacute;lidos en suspensi&oacute;n hasta &Oslash; 20 mm.</p>\r\n\r\n<p>- Tipo de agua: Limpia&nbsp;con s&oacute;lidos en suspenci&oacute;n</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo o fuente</p>\r\n\r\n<p>- Uso: Dom&eacute;stico</p>', 'subfamilias__BOMBA SUMERGIBLE PLASTICA MOTORARG.jpg', 'subfamilia36.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 07:03:25'),
(37, 'BOMBA SUMERGIBLE ACERO INOXIDABLE LEO', NULL, '<p>Las&nbsp;bombas sumergibles Leo se emplean para drenaje de agua&nbsp;y son aptas para uso dom&eacute;stico y distribuci&oacute;n de agua potable.</p>\r\n\r\n<p>Caracter&iacute;sticas:</p>\r\n\r\n<p>- Cuerpo de bomba en acero inoxidable</p>\r\n\r\n<p>- Interruptor flotante incorporado: asegura el corte y encendido de la bomba en forma autom&aacute;tica</p>\r\n\r\n<p>- Profundidad m&aacute;xima de inmersi&oacute;n: +7m</p>\r\n\r\n<p>- Descarga opcional superior&nbsp;o lateral</p>\r\n\r\n<p><span style=\"font-size:36px\">LINEA LKS-750PS</span></p>\r\n\r\n<p>- Apta para agua limpia Mod B45</p>\r\n\r\n<p>- Caudal m&aacute;ximo (Q M&aacute;x.): 225&nbsp;l/min</p>\r\n\r\n<p>- Altura m&aacute;xima (H M&aacute;x.):&nbsp;9,8m</p>\r\n\r\n<p><span style=\"font-size:36px\">LINEA LKS-758PSW</span></p>\r\n\r\n<p>- Apta para agua sucia&nbsp;Mod B46</p>\r\n\r\n<p>- Caudal m&aacute;ximo (Q M&aacute;x.):&nbsp;250&nbsp;l/min</p>\r\n\r\n<p>- Altura m&aacute;xima (H M&aacute;x.): 12m</p>\r\n\r\n<p>- Pasaje de s&oacute;lidos M&aacute;x.: 25mm</p>', 'subfamilias__BOMBA SUMERGIBLE ACERO INOXIDABLE LEO.jpg', 'subfamilia37.pdf', 14, '2019-01-07 22:54:30', '2019-03-30 02:27:32'),
(38, 'BOMBA PRESURIZADORA MOTORARG', NULL, '<p>Dise&ntilde;adas para presurizar instalaciones o sistemas dom&eacute;sticos.&nbsp;</p>\r\n\r\n<p><span style=\"font-size:36px\">TIP&nbsp;</span></p>\r\n\r\n<p>El equipo se acciona en el momento que se abre un consumo y se apaga cuando el mismo se detiene. No deja presurizada la ca&ntilde;er&iacute;a.</p>\r\n\r\n<p>- Tipo de Agua: Limpia</p>\r\n\r\n<p>- Instalacion: Tanque elevado</p>\r\n\r\n<p>- Uso: Dom&eacute;stico</p>\r\n\r\n<p><span style=\"font-size:36px\">HYDROFRESH&nbsp;</span></p>\r\n\r\n<p>Equipo integrado&nbsp;por una electrobomba, un presostato y un tanque hidroneum&aacute;ticos especialmente seleccionados para cada instalaci&oacute;n en funci&oacute;n a los consumos de agua existentes. Son armados con componentes de primer nivel internacional.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n:&nbsp;Tanque elevado o cisterna</p>\r\n\r\n<p>- Uso:<strong>&nbsp;</strong>Dom&eacute;stico, industrial, construcci&oacute;n civil.</p>', 'subfamilias__tip.motorarg.jpg', NULL, 14, '2019-01-07 22:54:30', '2019-03-30 07:28:45'),
(39, 'CENTRIFUGA LEO', NULL, '<p>Recomendadas en el uso dom&eacute;stico e industrial, abastecimiento urbano de agua, aumento de presi&oacute;n en edificios y equipos contraincendios, riego de jardines, trasvase de agua, calefacci&oacute;n, ventilaci&oacute;n, aire acondicionado, circulaci&oacute;n y aumento de presi&oacute;n para agua fr&iacute;a y caliente, etc.</p>\r\n\r\n<p>- Impulsor de ACERO INOXIDABLE.</p>\r\n\r\n<p>- Impulsor en BRONCE (2HP M, 2HP T).</p>\r\n\r\n<p>- Eje en ACERO INOXIDABLE.</p>\r\n\r\n<p>- Bobinado del motor en cobre.</p>\r\n\r\n<p>- Cuerpo de bomba en hierro fundido con tratamiento anticorrosi&oacute;n.</p>\r\n\r\n<p>- Caudal m&aacute;ximo (Qm&aacute;x): 160&nbsp;l/min.</p>\r\n\r\n<p>- Altura m&aacute;xima (Hm&aacute;x): 55 m.</p>', 'subfamilias__CENTRIFUGA LEO.jpg', 'subfamilia39.pdf', 14, '2019-01-07 22:54:31', '2019-03-30 07:41:52'),
(40, 'CENTRIFUGA NACIONAL', NULL, '<p><span style=\"font-size:36px\">LINEA BTM</span></p>\r\n\r\n<p>Motor monof&aacute;sico blindado con protecci&oacute;n IP44 y protector t&eacute;rmico incorporado.</p>\r\n\r\n<p>- Integramente fabricada en Argentina</p>\r\n\r\n<p>- Bajo consumo de energ&iacute;a</p>\r\n\r\n<p>- &Oacute;ptimo rendimiento y confiabilidad</p>\r\n\r\n<p>- Apto para uso domiciliario y sistemas de riego</p>\r\n\r\n<p>- Sello Dryrun con pistas de cer&aacute;mica y grfito</p>\r\n\r\n<p>- Motor el&eacute;ctrico blindado</p>\r\n\r\n<p>- Impulsor de Noryl y bronce</p>', 'subfamilias__CENTRIFUGA NACIONAL LINEA BTM.jpg', 'subfamilia40.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 01:58:47'),
(41, 'CENTRIFUGA MONOBLOCK MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA BC</span></p>\r\n\r\n<p>La l&iacute;nea de electrobombas centr&iacute;fugas monoblock BC&nbsp;est&aacute; dise&ntilde;ada para el bombeo de agua limpia para elevaci&oacute;n a tanques cisternas, en sistemas de presurizaci&oacute;n y en riegos.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n:<strong>&nbsp;</strong>Tanque elevado o cisterna</p>\r\n\r\n<p>- Uso: Agr&iacute;cola, industrial, construcci&oacute;n</p>', 'subfamilias__bc235.motorarg.jpg', 'subfamilia41.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 01:51:26'),
(42, 'ELECTROBOMBA TRITURADORA MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA DRT</span></p>\r\n\r\n<p>La l&iacute;nea de electrobombas sumergibles port&aacute;tiles trituradoras para desagote DRT, brinda una &oacute;ptima prestaci&oacute;n hidr&aacute;ulica en el bombeo de aguas sucias o cargadas con s&oacute;lidos en suspensi&oacute;n y fibras largas debido a su sistema de cortador axial. Es apta para el bombeo en sumideros, desag&uuml;es pluviales y cloacales, hospitales y cl&iacute;nicas, s&oacute;tanos, etc, sumergi&eacute;ndola directamente en el lugar a desagotar.</p>\r\n\r\n<p>- Tipo de agua: Sucia con s&oacute;lidos hasta hasta &Oslash; 50 mm</p>\r\n\r\n<p>- Instalaci&oacute;n: Pozo, obra, sumidero, etc.</p>\r\n\r\n<p>- Uso: Dom&eacute;stico, agr&iacute;cola, industrial, construcci&oacute;n civil</p>', 'subfamilias__ELECTROBOMBA TRITURADORA MOTORARG.jpg', 'subfamilia42.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 02:19:48'),
(43, 'ELECTROBOMBA AUTOCEBANTE MOTORARG', NULL, '<p><span style=\"font-size:36px\">LINEA POOL</span></p>\r\n\r\n<p>La l&iacute;nea de electrobomba autocebante Pool&nbsp;est&aacute; dise&ntilde;ada para la recirculaci&oacute;n, filtrado y desagote de piscinas.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n: Piscinas privadas</p>\r\n\r\n<p>- Uso: Dom&eacute;stico</p>', 'subfamilias__ELECTROBOMBA AUTOCEBANTE MOTORARG LINEA POOL.jpg', 'subfamilia43.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 01:41:23'),
(44, 'ELECTROBOMBA AUTOCEBANTE LEO', NULL, '<p><span style=\"font-size:36px\">LINEA XKP</span></p>\r\n\r\n<p>Utilizadas para la circulaci&oacute;n de agua en piscinas de agua medianas y peque&ntilde;as.</p>\r\n\r\n<p>- Impulsor de NORYL</p>\r\n\r\n<p>- Cuerpo de bomba en pl&aacute;stico de ingenier&iacute;a</p>\r\n\r\n<p>- Eje en acero inoxidable AISI 304</p>\r\n\r\n<p>- Temperatura m&aacute;x. del l&iacute;quido: +35&deg;C</p>\r\n\r\n<p>- M&aacute;x. aspiraci&oacute;n: +3.5 m</p>\r\n\r\n<p>- Caudal m&aacute;ximo (Qmax.): 350&nbsp;l/min</p>\r\n\r\n<p>- Altura m&aacute;xima (Hmax): 13/2m</p>', 'subfamilias__eletrobomba-para-piscina-mod-leo-xkp-554.jpg', 'subfamilia44.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 01:27:41'),
(45, 'PERIFERICA', NULL, '<p>Dise&ntilde;adas para extraer agua limpia y recircularla.</p>\r\n\r\n<p>- Agua limpia neutra sin abrasivos solidos</p>\r\n\r\n<p>- Temperatura no superior a 60&deg;C</p>\r\n\r\n<p>- Presion m&agrave;xima de trabajo 10BAR</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__PERIFERICA.jpg', NULL, 14, '2019-01-07 22:54:31', '2019-03-31 08:15:41'),
(46, 'PRESURIZADOR BAT - BTM', NULL, '<p><span style=\"font-size:36px\">LINEA BAT </span></p>\r\n\r\n<p>La l&iacute;nea de equipos presurizadores BAT de BTM es aplicable a sistemas con tanque elevado, permite presurizar instalaciones abasteciendo desde 2 a 8 suministros.</p>\r\n\r\n<p>Los equipos BAT no dejan la instalaci&oacute;n presurizada cuando se los suministros est&aacute;n cerrados, esto permite que sean aplicables a instalaciones de agua caliente con termotanque. La bomba de los equipos BAT es de motor frio con un bajo consumo el&eacute;ctrico y est&aacute; protegida contra marchas en seco.</p>', 'subfamilias__PRESURIZADOR BAT - BTM.jpg', 'subfamilia46.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 03:23:09'),
(47, 'PRESURIZADOR CST - BTM', NULL, '<p><span style=\"font-size:36px\">LINEA CST </span></p>\r\n\r\n<p>La l&iacute;nea de equipos presurizadores CST de BTM es aplicable a sistemas sin tanque elevado.&nbsp;</p>\r\n\r\n<p>Permite presurizar instalaciones abasteciendo desde 3 a 10 suministros. Dado que los equipos CST est&aacute;n provistos de tanques de expansi&oacute;n de 4 litros, son aplicables a instalaciones de agua caliente con termotanque. La bomba de los equipos CST es de motor frio con un bajo consumo el&eacute;ctrico y est&aacute; protegida contra marchas en seco.</p>', 'subfamilias__PRESURIZADOR CST - BTM.jpg', 'subfamilia47.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 03:37:21'),
(48, 'RECIRCULADORA PARA CALEFACCION', NULL, '<p><span style=\"font-size:36px\">LINEA RCL DEGASSER</span></p>\r\n\r\n<p>La l&iacute;nea de electrobombas RCL DEGASSER para calderas murales, son de tipo rotor encapsulado:&nbsp;bomba y motor forman una unidad integrada sin sello mec&aacute;nico y con s&oacute;lo dos juntas para sellado.<br />\r\nLos cojinetes est&aacute;n lubricados por el l&iacute;quido bombeado.</p>\r\n\r\n<p>- Tipo de agua: Limpia</p>\r\n\r\n<p>- Instalaci&oacute;n: Caldera manual</p>\r\n\r\n<p>- Uso: Uso dom&eacute;stico</p>', 'subfamilias__RECIRCULADORA PARA CALEFACCION 1.jpg', 'subfamilia48.pdf', 14, '2019-01-07 22:54:31', '2019-03-31 03:55:06'),
(49, 'BASE ANTIVIBRATORIA PARA BOMBA DE AGUA', NULL, '<p>Acabado: Negro en pintura epoxi&nbsp;</p>\r\n\r\n<p>Ind. Argentina.</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__BASE PARA BOMBA DE AGUA.jpg', NULL, 15, '2019-01-07 22:54:31', '2019-03-31 04:45:28'),
(50, 'CONTROLADOR DE FLUJO Y PRESION', NULL, '<p><span style=\"font-size:36px\">FLOWCONTROL</span></p>\r\n\r\n<p>Es&nbsp;un sensor de &ldquo;flujo&rdquo; dise&ntilde;ado para evita el funcionamiento en seco de la electrobomba, controla el arranque y parada de la electrobomba.&nbsp;</p>\r\n\r\n<p>Tipo de agua: Limpia</p>\r\n\r\n<p>Instalaci&oacute;n: Tanque Elevado</p>\r\n\r\n<p>Uso: Uso dom&eacute;stico</p>\r\n\r\n<p><span style=\"font-size:36px\">HYDROCONTROL </span></p>\r\n\r\n<p>Es&nbsp;un sensor de &ldquo;flujo&rdquo; dise&ntilde;ado para evitar&nbsp;el funcionamiento en seco de la electrobomba, controla el arranque y parada de la electrobomba.&nbsp;</p>\r\n\r\n<p>Tipo de agua: Limpia</p>\r\n\r\n<p>Instalaci&oacute;n: Tanque Elevado o Cisterna</p>\r\n\r\n<p>Uso: Uso dom&eacute;stico</p>', 'subfamilias__HYDRO.jpg', NULL, 15, '2019-01-07 22:54:31', '2019-04-15 12:58:53'),
(51, 'PROTECTOR MARCHA EN SECO PDMS', NULL, '<p><span style=\"font-size:36px\">PDMS </span></p>\r\n\r\n<p>Es un interruptor que sensa el paso del agua, y ante ausencia de la misma, activa su protecci&oacute;n, cortando la ener&shy;g&iacute;a de alimentaci&oacute;n el&eacute;ctrica de la bomba, protegi&eacute;ndola de su marcha en seco. Dise&ntilde;ado para ser usado en electrobombas centr&iacute;fugas.</p>\r\n\r\n<p>Tipo de agua: Limpia</p>\r\n\r\n<p>Instalaci&oacute;n:&nbsp;Tanque elevado</p>\r\n\r\n<p>Uso: Uso dom&eacute;stico</p>', 'subfamilias__PROTECTOR MARCHA EN SECO PDMS.jpg', NULL, 15, '2019-01-07 22:54:31', '2019-03-31 04:55:00'),
(52, 'ANAFE', NULL, '<p>Anafes enlozados de una y dos hornallas con termocupla.</p>\r\n\r\n<p>- Regulaci&oacute;n independiente de temperatura<br />\r\n- Parrilla desmontable<br />\r\n- Cuerpo enlozado<br />\r\n- Color blanco<br />\r\n- V&aacute;lvula de seguridad</p>\r\n\r\n<p>Medidas:</p>\r\n\r\n<p><em>1 hornalla:&nbsp;30 cm x 30 cm x&nbsp;8&nbsp;cm<br />\r\n2 hornallas:&nbsp;50 cm x 30 cm x 8&nbsp;cm</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__ANAFE 1 HORNALLA BROGAS.jpg', NULL, 16, '2019-01-07 22:54:31', '2019-03-31 06:54:38'),
(53, 'CALEFON', NULL, NULL, 'subfamilias__CALEFON BROGAS.jpg', NULL, 16, '2019-01-07 22:54:31', '2019-04-22 08:46:23'),
(54, 'CALENTADORES Y FAROLES', NULL, '<p style=\"margin-left:0cm; margin-right:0cm\"><span style=\"font-size:20px\">BRO405</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">Calentador de Gas enlozado VIAJERO&nbsp;con aro sujeta pava.<br />\r\n<em>Medidas: &Oslash;17.2cm x 11cm</em></p>\r\n\r\n<p><span style=\"font-size:20px\">BRO407</span></p>\r\n\r\n<p>Calentador de gas CL&Aacute;SICO&nbsp;enlozado.<br />\r\n<em>Medidas: &Oslash;17.2cm x 7,5cm</em></p>\r\n\r\n<p><span style=\"font-size:20px\">BRO408</span></p>\r\n\r\n<p>Calentador de gas CL&Aacute;SICO VIAJERO enlozado.<br />\r\n<em>Medidas: &Oslash;17.2cm x 11cm</em></p>\r\n\r\n<p><span style=\"font-size:20px\">BROGL02</span></p>\r\n\r\n<p style=\"margin-left:0cm; margin-right:0cm\">Farol de lujo con jaula 500 Buj&iacute;as.<br />\r\n<em>Medidas: &Oslash;16cm x 21cm</em></p>', 'subfamilias__CALENTADORES Y FAROLES.jpg', NULL, 16, '2019-01-07 22:54:31', '2019-03-31 07:28:22'),
(55, 'DUCHA ELECTRICA', NULL, '<p>Material: Pl&aacute;stico</p>\r\n\r\n<p>Acabado: Gris y blanco</p>\r\n\r\n<p>Niveles de Temperatura: 3</p>\r\n\r\n<p>Tipo de Instalaci&oacute;n: Exterior</p>', 'subfamilias__LLUVIA ELECTRICA BROGAS.jpg', NULL, 16, '2019-01-07 22:54:31', '2019-03-31 07:37:20'),
(56, 'PANTALLA CON ANALIZADOR DE AMBIENTE', NULL, '<p>Pantallas con piloto analizador de ambiente GN o GE aprobadas.</p>\r\n\r\n<div><span style=\"font-size:18px\">BRO5400/5401: PANTALLA&nbsp;1300 CALOR&Iacute;AS&nbsp;</span></div>\r\n\r\n<div><em>Medidas: 27cm x 24.5cm x 14cm</em></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><span style=\"font-size:18px\">BRO5600/5601: PANTALLA 2600 CALOR&Iacute;AS</span></div>\r\n\r\n<div><em>Medidas: 25cm x 39,5cm x 19cm</em></div>\r\n\r\n<div>&nbsp;</div>\r\n\r\n<div><span style=\"font-size:18px\">BRO5955/5956: PANTALLA 3000-6000 CALOR&Iacute;AS DE 2 V&Iacute;AS</span></div>\r\n\r\n<div><em>Medidas: 47,5cm x 38,5cm x 22cm</em></div>', 'subfamilias__PANTALLA CON ANALIZADOR DE AMBIENTE.jpg', NULL, 16, '2019-01-07 22:54:31', '2019-03-31 07:46:22'),
