(60, 'SOPLETES', NULL, '<p><span style=\"font-size:24px\">BRO702</span></p>\r\n\r\n<p>Soplete para cartucho de GAS BUTANO de&nbsp;227g. con encendido electr&oacute;nico.<br />\r\n<em>Medidas: 6cm x 15cm</em></p>\r\n\r\n<p><span style=\"font-size:24px\">BRO703</span></p>\r\n\r\n<p>Soldador sistema clip para cartucho de GAS BUTANO de 227g.<br />\r\n<em>Medidas: 20cm x 8cm</em></p>', 'subfamilias__SOPLETES.jpg', NULL, 16, '2019-01-07 22:54:31', '2019-03-31 08:08:20'),
