(87, 'CANILLA ESFERICA PVC MG', NULL, '<p>- Fabricada &iacute;ntegramente en polipropileno virgen</p>\r\n\r\n<p>- Se puede conectar a rosca 1/2&Prime; y 3/4&Prime; por lo cual permite ser utilizada para lavarropas autom&aacute;tico.</p>\r\n\r\n<p>- Apta para Baja Temperatura.</p>\r\n\r\n<p>- Apta para productos qu&iacute;micos.</p>\r\n\r\n<p>-Cuenta con sistema Conecta F&aacute;cil (con sello tipo o&acute;ring) sin tefl&oacute;n, ni pasta rosca.</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__CANILLA ESFERICA PVC MG.jpg', NULL, 138, '2019-01-07 22:54:35', '2019-04-03 09:12:39'),
