(107, 'CALISUAR', NULL, '<p>Calisuar conformado en metal duro.&nbsp;Posee una empu&ntilde;adura de bronce, un tramo cil&iacute;ndrico y una hoja&nbsp;facetada de tres caras (piramidal). Cuanto m&aacute;s larga sea la hoja facetada, m&aacute;s precisa resulta la herramienta.</p>\r\n\r\n<p>Longitudes que el calisuar debe penetrar&nbsp;para convertir inyectores para GAS ENVASADO en inyectores preparados para GAS&nbsp;NATURAL:</p>\r\n\r\n<p><em>- Inyector quemador hornalla grande:&nbsp;<strong>21,01 mm</strong>.</em></p>\r\n\r\n<p><em>- Inyector quemador hornalla mediana:&nbsp;<strong>13,85 mm</strong></em></p>\r\n\r\n<p><em>- Inyector quemador hornalla chica:&nbsp;<strong>11,13 mm</strong>.</em></p>\r\n\r\n<p><em>- Inyector quemador horno:&nbsp;<strong>27,94 mm</strong></em></p>', 'subfamilias__CALISUAR.jpg', NULL, 32, '2019-01-07 22:54:36', '2019-04-05 02:18:07'),
(108, 'CARTON AISLANTE', NULL, '<p>Este producto esta indicado para evitar la propagaci&oacute;n del calor generado por el calor del horno de una cocina de uso domiciliario hacia los muebles laterales o paredes posteriores a la misma.</p>\r\n\r\n<p>Medidas: 55 cm de ancho x 85 cm de largo</p>\r\n\r\n<p>Espesor: 2.5 mm</p>', 'subfamilias__CARTON AISLANTE.jpg', NULL, 32, '2019-01-07 22:54:36', '2019-04-15 02:25:46'),
