(168, 'FLEXIBLE DE COBRE CROMADO RAO', NULL, '<p>Tubo de conexi&oacute;n para artefactos sanitarios</p>\r\n\r\n<p>- Cobre 99,9% pureza.&nbsp;Acabado cromado</p>\r\n\r\n<p>- Recocido y plegado que permite flexiones sin deformaciones ni roturas</p>\r\n\r\n<p>- Soporta 3kg. de presi&oacute;n x cm&sup2;&nbsp;y 300&deg; de temperatura</p>\r\n\r\n<p>- Rosca de&nbsp;1/2M x 1/2H desde 15cm&nbsp;a 50cm. Rosca de 3/4M x 3/4H&nbsp;desde 20 a 50cm</p>', 'subfamilias__TUBOFLEX.jpg', NULL, 42, '2019-01-07 22:54:39', '2019-04-22 12:19:12'),
(169, 'FLEXIBLE MALLADO PARA MONOCOMANDO', NULL, NULL, 'subfamilias__FLEXIBLE MONOCOMANDO.jpg', NULL, 42, '2019-01-07 22:54:39', '2019-04-07 10:32:43'),
(170, 'FLEXIBLE MALLADO TMF', NULL, NULL, 'subfamilias__FLEXIBLE TMG.jpg', NULL, 42, '2019-01-07 22:54:40', '2019-04-07 10:39:29'),
(171, 'FLEXIBLE MALLADO TMG', NULL, NULL, 'subfamilias__FLEXIBLE T.M.G.jpg', NULL, 42, '2019-01-07 22:54:40', '2019-04-07 10:45:04'),
(172, 'FLEXIBLE PLASTICO REGULABLE CRISTAL', NULL, '<p>Este flexible est&aacute;&nbsp;provisto&nbsp;con un terminal fijo con tuerca hembra con rosca de 1/2&quot;, permitiendo la regulaci&oacute;n exacta del largo necesario en el otro extremo. El mismo queda fijado por medio de una tuerca con asiento c&oacute;nico y una entrerrosca especial que garantiza el cierre perfecto.</p>\r\n\r\n<p>Material: PVC con malla tejida</p>\r\n\r\n<p>Terminal:&nbsp;Polipropileno</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__FLEXIBLE CRISTAL.jpg', NULL, 42, '2019-01-07 22:54:40', '2019-04-07 10:48:34'),
(173, 'FLEXIBLE PLASTICO REGULABLE GRIS', NULL, '<p>Este flexible est&aacute;&nbsp;provisto&nbsp;con un terminal fijo con tuerca hembra con rosca de 1/2&quot;, permitiendo la regulaci&oacute;n exacta del largo necesario en el otro extremo. El mismo queda fijado por medio de una tuerca con asiento c&oacute;nico y una entrerrosca especial que garantiza el cierre perfecto.</p>\r\n\r\n<p>Material: PVC</p>\r\n\r\n<p>Terminales: Polipropileno</p>', 'subfamilias__FLEXIBLE ERREDE.jpg', NULL, 42, '2019-01-07 22:54:40', '2019-04-07 10:52:59'),
(174, 'FLEXIBLE ACERO INOXIDABLE APROBADO', NULL, '<p>Flexible aprobado de longitud fija&nbsp;para gas que agiliza y facilita la instalaci&oacute;n de todo tipo de artefacto a gas natural o envasado (cocinas, hornos, anafes, etc.).</p>', 'subfamilias__FLEXIBLE ACERO INOXIDABLE APROBADO.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-07 11:09:40'),
(175, 'FLEXIBLE ACERO INOXIDABLE EXTENSIBLE APROBADO', NULL, '<p>Flexible de longitud extensible, aprobada para gas que agiliza y facilita la instalaci&oacute;n de todo tipo de artefacto a gas natural o envasado (cocinas, hornos, anafes, etc.).</p>', 'subfamilias__FLEXIBLE ACERO INOXIDABLE EXTENSIBLE APROBADO.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-14 12:12:27'),
(176, 'FLEXIBLE MALLADO PARA GAS', NULL, NULL, 'subfamilias__FLEXIBLE MALLADO PARA GAS.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-14 12:03:37'),
(177, 'FLEXIBLE PARA GABINETE DE GAS', NULL, '<p>Flexible de longitud extensible, aprobada para gas especialmente dise&ntilde;ada para agilizar y facilitar la instalaci&oacute;n de&nbsp;medidores de gas.</p>\r\n\r\n<p>Este&nbsp;modelo es indicado para medidores con rosca de 1 1/4&quot;.</p>\r\n\r\n<p>- Longitud: 30 a 70 cm.</p>\r\n\r\n<p>- Ca&ntilde;o flexible corrugado: Acero Inoxidable AISI 316L</p>\r\n\r\n<p>- Macho Fijo 3/4&quot;: Acero Inoxidable AISI 303, rosca BSPT</p>\r\n\r\n<p>- Tuerca Giratoria: Lat&oacute;n Niquelado, rosca BSPP</p>\r\n\r\n<p>- Asiento de Acero inoxidable inyectado para prevenir corrientes diel&eacute;ctricas</p>', 'subfamilias__FLEXIBLE PARA GABINETE DE GAS.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-14 12:33:21'),
(178, 'FLEXIBLE PARA CALEFACTOR', NULL, '<p>Flexible de longitud extensible, aprobada para gas espacialmente dise&ntilde;ada para &nbsp;agilizar y facilitar la instalaci&oacute;n de calefactores a gas natural o envasado.</p>\r\n\r\n<p>- Ca&ntilde;o flexible corrugado: Acero Inoxidable AISI 316L</p>\r\n\r\n<p>- Macho Fijo 1/2&quot;: Acero Inoxidable AISI 303, rosca BSPT</p>\r\n\r\n<p>- Tuerca Giratoria 1/4&quot;: Lat&oacute;n Niquelado rosca BSPP y tubo con cierre a virola.&nbsp;</p>', 'subfamilias__FLEXIBLE PARA CALEFACTOR.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-14 12:26:00'),
(179, 'FLEXIBLE PARA RADIADOR', NULL, '<p>Flexible de longitud extensible que agiliza y facilita la instalaci&oacute;n de radiadores.</p>\r\n\r\n<p>Su sello c&oacute;nico de material elastom&eacute;rico facilita su montaje, sin necesidad de utilizar cinta de teflon ni otros selladores. Con solo un par de aprietes de 25 Nm, la instalaci&oacute;n estar&aacute; terminada.</p>\r\n\r\n<p>- Ca&ntilde;o flexible corrugado: Acero Inoxidable AISI 316L</p>\r\n\r\n<p>- Macho Fijo 1/2&quot;: Acero Inoxidable AISI 303, rosca BSPP</p>\r\n\r\n<p>- Sello: C&oacute;nico Elsatom&eacute;rico.</p>', 'subfamilias__FLEXIBLE PARA RADIADOR.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-14 12:36:38'),
(180, 'FLEXIBLE PARA TERMOTANQUE', NULL, '<p>Flexible de longitud extensible, aprobada para gas especialmente dise&ntilde;ada para facilitar y agilizar la instalaci&oacute;n de termotanques a gas natural o envasado.</p>\r\n\r\n<p>- Ca&ntilde;o flexible corrugado: Acero Inoxidable AISI 316L</p>\r\n\r\n<p>- Macho Fijo 1/2&quot; Gas: Acero Inoxidable AISI 303, rosca BSPT</p>\r\n\r\n<p>- Tuerca Giratoria 3/8&quot; BSPP : Lat&oacute;n Niquelado &nbsp;y tubo con cierre a virola 3/8&quot;</p>', 'subfamilias__FLEXIBLE PARA TERMOTANQUE.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-14 12:40:28'),
(181, 'KIT DE INSTALACION', NULL, '<p>Kits&nbsp;para instalaci&oacute;n permiten ahorrar tiempo y dinero, porque ofrece todos los flexibles necesarios para la instalaci&oacute;n.</p>', 'subfamilias__KITS DE INSTALACION.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-22 12:24:04'),
(182, 'ROSETA PARA RADIADOR', NULL, '<p>Este producto est&aacute; fabricado en acero inoxidable, y su aplicaci&oacute;n le brinda una mejor terminaci&oacute;n a las conexiones flexibles que van roscadas en cuplas empotradas en la pared, como termotanques y calefones.</p>', 'subfamilias__ROSETAS PARA RADIADOR.jpg', NULL, 43, '2019-01-07 22:54:40', '2019-04-22 12:23:40'),
(183, 'FLOTANTE PARA DEPOSITO', NULL, NULL, 'subfamilias__FLOTANTE PARA DEPOSITO.jpg', NULL, 44, '2019-01-07 22:54:40', '2019-04-14 13:12:49'),
