(193, 'FLOTANTE ERREDE TUERCA BRONCE', NULL, '<p>Soportan las m&aacute;s elevadas presiones. Ofrecen apreciables ventajas en zonas de aguas duras o aguas corrientes purificadas con sulfato de cobre.&nbsp;</p>\r\n\r\n<p>- Brazo de bronce trefilado con regulaci&oacute;n de nivel, mediante tornillo de igual material.</p>\r\n\r\n<p>- Tapa a rosca que facilita su reparaci&oacute;n sin desmontar la v&aacute;lvula de su conexi&oacute;n.</p>\r\n\r\n<p>- Adaptable a cualquier boya con rosca 5/16 w.</p>\r\n\r\n<p>- Conexion: Horizontal</p>\r\n\r\n<p>- Tuerca: Bronce Hembra&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__FLOTANTE ERREDE TUERCA BRONCE.jpg', NULL, 47, '2019-01-07 22:54:41', '2019-04-14 14:19:24'),
(194, 'FLOTANTE ERREDE TUERCA PLASTICA', NULL, '<p>Soportan las m&aacute;s elevadas presiones. Ofrecen apreciables ventajas en zonas de aguas duras o aguas corrientes purificadas con sulfato de cobre.&nbsp;</p>\r\n\r\n<p>- Brazo de bronce trefilado con regulaci&oacute;n de nivel, mediante tornillo de igual material.</p>\r\n\r\n<p>- Tapa a rosca que facilita su reparaci&oacute;n sin desmontar la v&aacute;lvula de su conexi&oacute;n.</p>\r\n\r\n<p>- Adaptable a cualquier boya con rosca 5/16 w.</p>\r\n\r\n<p>- Conexion: Horizontal</p>\r\n\r\n<p>- Tuerca: Polipropileno&nbsp;Hembra&nbsp;</p>', 'subfamilias__FLOTANTE ERREDE TUERCA PLASTICA.jpg', NULL, 47, '2019-01-07 22:54:41', '2019-04-14 14:21:57'),
