(212, 'LLAVE DE PASO', NULL, '<p>La llave de paso total Eco Agua tiene una seccion de caudal constante en todo el recorrido. Muy buen rendimiento hidr&aacute;ulico con baja resistencia al pasaje de flujo.&nbsp;</p>\r\n\r\n<p>- Inserto de bronce.</p>\r\n\r\n<p>- Cabezal con cuerpo de pol&iacute;mero de ingenier&iacute;a&nbsp;con v&aacute;stago y componentes de bronce.</p>', 'subfamilias__LLAVE DE PASO.jpg', NULL, 50, '2019-01-07 22:54:42', '2019-04-08 12:21:59'),
