(218, 'TUBO CONDUCCION AGUA CALIENTE', NULL, '<p><span style=\"font-size:36px\">LINEA PN20</span></p>\r\n\r\n<p>Estos tubos poseen una mayor seccion de paso, conduciendo de esta forma mayor caudal a lo largo de toda la instalacion.&nbsp;</p>\r\n\r\n<p>PN20&nbsp;Presion Nominal de trabajo 20Kg/Cm2</p>\r\n\r\n<p>Marcado: Hot Stamping</p>\r\n\r\n<p>Linea Continua Amarilla</p>', 'subfamilias__AGUA CALIENTE.jpg', NULL, 50, '2019-01-07 22:54:42', '2019-04-08 12:50:24'),
(219, 'TUBO CONDUCCION AGUA FRIA', NULL, '<p><span style=\"font-size:36px\">LINEA PN12</span></p>\r\n\r\n<p>Tubos para conduccion de agua fria exclusivamente de optimo rendimiento en columnas montantes y ramalas de derivacion de edificios.</p>\r\n\r\n<p>PN12 Presion Nominal de trabajo 12Kg/Cm2</p>\r\n\r\n<p>Marcado: Hot Stamping</p>\r\n\r\n<p>Linea Continua Blanca</p>', 'subfamilias__AGUA FRIA.jpg', NULL, 50, '2019-01-07 22:54:42', '2019-04-08 12:53:46'),
(220, 'TUBO CONDUCCION ALTA EXIGENCIA', NULL, '<p><span style=\"font-size:36px\">LINEA PN25</span></p>\r\n\r\n<p>Permite satisfacer rigurosos requerimientos de presion y temperatura.</p>\r\n\r\n<p>PN25 Presion Nominal de tranajo 25Kg/Cm2</p>\r\n\r\n<p>Marcado: Hot Stamping</p>\r\n\r\n<p>Linea Continua Naranja</p>', 'subfamilias__ALTA EXIGENCIA.jpg', NULL, 50, '2019-01-07 22:54:42', '2019-04-08 12:57:09'),
