(451, 'ANODOS PARA TERMOTANQUE', NULL, '<p>&Aacute;nodo de magnesio para termotanques.</p>\r\n\r\n<p>- Aleaci&oacute;n AZ - 31B o alto potencial, seg&uacute;n sea el tipo de agua.</p>\r\n\r\n<p>- Di&aacute;metro de 19 a 21,3 mm.</p>\r\n\r\n<p>- Tap&oacute;n de acero para roscar en cupla 3/4&#39;&#39; gas.</p>\r\n\r\n<p>- Longitud de acuerdo con su necesidad.</p>\r\n\r\n<p>- Alambre de acero, soldado al tap&oacute;n, que acompa&ntilde;a al &aacute;nodo en toda su longitud para asegurar una completa utilizaci&oacute;n del&nbsp;material del &aacute;nodo.</p>', 'subfamilias__ANODOS.jpg', NULL, 88, '2019-01-07 22:54:56', '2019-04-08 11:26:21'),
