(625, 'ASIENTO INODORO DE UREA', NULL, '<p>Material: Urea</p>\r\n\r\n<p>Incluye doble kit de fijacion, Tornillo pasante y no pasante.</p>\r\n\r\n<p>Instalacion con anclaje encastrable. Facil instalacion</p>\r\n\r\n<p><img alt=\"\" src=\"Z:\\WEB ZALAZAR\\jpg\\Fotos Zalazar\\asur1.jpg\" /></p>', 'no-image.jpg', NULL, 65, '2019-01-22 22:46:43', '2019-01-31 16:56:13'),
(626, 'ASIENTO LAQUEADO PARA INODORO', NULL, '<p>- MDF de alta densidad</p>\r\n\r\n<p>- Dise&ntilde;o anatomico</p>\r\n\r\n<p>- Color blanco</p>\r\n\r\n<p>- Acabado laqueado brillante</p>\r\n\r\n<p><span dir=\"ltr\" lang=\"es\">- Herrajes de nylon</span><br />\r\n&nbsp;</p>', 'subfamilias__ASIENTO LAQUEADO PARA INODORO.jpg', NULL, 65, '2019-01-22 22:46:43', '2019-04-13 06:50:05'),
(627, 'ASIENTO UNIVERSAL PARA INODORO SOPLADO', NULL, '<p>- Acabado mate</p>\r\n\r\n<p>- Medidas:</p>\r\n\r\n<p><em>Largo: 44 cm&nbsp;</em></p>\r\n\r\n<p><em>Ancho: 39 cm</em></p>\r\n\r\n<p><em>Entre centro de tornillos: Max 19.5 cm - Min 12 cm</em></p>\r\n\r\n<h2>&nbsp;</h2>', 'subfamilias__ASIENTO UNIVERSAL PARA INODORO SOPLADO.jpg', NULL, 65, '2019-01-22 22:46:43', '2019-04-13 06:54:13'),
