(640, 'DISPOSITIVO ANTISARRO', NULL, '<p>Mediante un campo magn&eacute;tico, el dispositivo antisarro <strong>Clear Tube</strong>, polariza el agua que circula por la ca&ntilde;eria evitando que el sarro se deposite en tanques, tuberias, termotanques o equipos industriales,&nbsp;ayudando tambi&eacute;n a eliminar los dep&oacute;sitos calc&aacute;reos preexistentes y disminuyendo la posible corrosi&oacute;n.</p>', 'subfamilias__ANTISARRO BTM.jpg', 'subfamilia640.pdf', 11, '2019-01-28 03:24:25', '2019-03-29 21:38:54'),
(642, 'ANAFE ELECTRICO', NULL, '<p>- Gabinete met&aacute;lico<br />\r\n- Encendido el&eacute;ctrico<br />\r\n- Un termostato&nbsp;por hornalla<br />\r\n- Protecci&oacute;n antiderrames y antirecalentamiento<br />\r\n- 1000 watts por hornalla de potencia<br />\r\n- Regulador de temperatura de 6 niveles<br />\r\n- Indicador luminoso de funcionamiento<br />\r\n- Normas IRAM y Seguridad El&eacute;ctrica<br />\r\n- Patas de goma</p>\r\n\r\n<p>Medidas:</p>\r\n\r\n<p><em>1 Hornalla: 24cm&nbsp;x 24cm x 6 cm<br />\r\n2 Hornallas: 44cm&nbsp;x 24cm x 6 cm</em></p>', 'subfamilias__ELECTRICO 1.jpg', NULL, 16, '2019-01-30 05:14:23', '2019-04-22 08:46:05'),
(643, 'ANAFE CON VALIJA', NULL, '<p>Anafe de una&nbsp;hornalla con valija y encendido electr&oacute;nico para cartucho gas de butano de 227grms (C&oacute;d.&nbsp;BRO99).</p>\r\n\r\n<p>Aprobado por&nbsp;IGA.</p>\r\n\r\n<p>Medidas: <em>27cm&nbsp;x 36cm x 10cm</em></p>', 'subfamilias__ANAFE CON VALIJA1.jpg', NULL, 16, '2019-01-30 05:14:58', '2019-03-31 06:27:01'),
(644, 'ANAFE CON TERMOCUPLA APROBADO', NULL, '<p>- Regulaci&oacute;n independiente de temperatura<br />\r\n- Parrilla desmontable<br />\r\n- Cuerpo enlozado<br />\r\n- Color negro<br />\r\n- V&aacute;lvula de seguridad</p>\r\n\r\n<p>Medidas:</p>\r\n\r\n<p><em>1 hornalla:&nbsp;30 cm x 30 cm x 9 cm<br />\r\n2 hornallas:&nbsp;50 cm x 30 cm x 9 cm</em></p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__ANAFE CON TERMOCUPLA APROBADO01.jpg', NULL, 16, '2019-01-30 05:16:06', '2019-03-31 06:48:06'),
(645, 'CARTUCHO DE GAS', NULL, '<p>Cartucho de&nbsp;GAS BUTANO descartable de 227 grs.</p>\r\n\r\n<p>Medidas:<em> 20cm x &Oslash;7cm</em></p>', 'subfamilias__CARTUCHO DE GAS BROGAS.jpg', NULL, 16, '2019-01-30 05:16:35', '2019-03-31 06:31:49'),
(649, 'REJA CONICA REFORZADA', NULL, '<p><span style=\"font-size:36px\">MODELO CUADRADO</span></p>\r\n\r\n<p>Exclusivo dise&ntilde;o en metal desplegado que se adapta a todo tipo de espacios y brinda una mejor terminaci&oacute;n<br />\r\nSu fabricaci&oacute;n en planchuela de hierro ofrece mayor rigidez que sus competidoras</p>', 'subfamilias__REJA CONICA REFORZADA.jpg', NULL, 79, '2019-02-05 21:54:17', '2019-04-14 07:59:05'),
(650, 'TAPA CAMARA CONICA REFORZADA', NULL, '<p>Dise&ntilde;ada para brindar una mejor resistencia y terminaci&oacute;n que las tapas c&aacute;mara convencionales.</p>\r\n\r\n<p>- Su forma c&oacute;nica permite resistir mayor peso, pudiendo utilizarse tanto en interiores como exteriores<br />\r\n- No tienen filete para brindar mejor terminaci&oacute;n y seguridad<br />\r\n- Fabricado en 3 cm y 5 cm&nbsp;de profundidad<br />\r\n- Incluye bul&oacute;n standard</p>', 'subfamilias__TAPA CAMARA CONICA REFORZADA.jpg', NULL, 85, '2019-02-05 21:54:17', '2019-04-10 12:07:24'),
(652, 'MEZCLADORA COCINA MESADA', NULL, NULL, 'subfamilias__MEZCLADORA COCINA MESADA.jpg', NULL, 58, '2019-02-05 22:18:33', '2019-04-16 07:10:05'),
(656, 'SIFON METALICO PARA COCINA RAO', NULL, '<p>-Sifones cromados cuerpos de lat&oacute;n</p>\r\n\r\n<p>-Tubos de cobre 99,9% pureza</p>\r\n\r\n<p>-Acabado cromado</p>\r\n\r\n<p>&nbsp;</p>', 'subfamilias__SIFON METALICO PARA COCINA RAO.jpg', NULL, 81, '2019-02-05 22:18:33', '2019-04-11 08:07:30'),
